● Discard 1 random card from their hand.
● Send the top 2 cards of their Deck to the GY.

Cannot attack the turn it is Summoned. While you control "Toon World" and your opponent controls no Toon monsters, this card can attack your opponent directly. Once per turn: You can discard 1 "Toon" card, then activate 1 of these effects;
● Special Summon 1 Toon monster from your Deck, except "Toon Dark Magician", ignoring its Summoning conditions.
● Add 1 "Toon" Spell/Trap from your Deck to your hand.

If you control a Dragon monster: Activate 1 of these effects;
● Inflict 800 damage to your opponent.
● Target 1 monster with 800 or less DEF; destroy that target.

Activate 1 of these effects;
● Target 1 face-up monster your opponent controls; change that target's battle position.
● Tribute 1 monster, then target 1 face-up monster your opponent controls; take control of that target until the End Phase.

Activate 1 or both of these effects (simultaneously);
● When an opponent's monster declares an attack: Target the attacking monster; change that target to Defense Position.
● Target 1 face-up monster you control; equip this card to that target. It gains 500 ATK.
